import React from 'react';
import Hero from './siteComponents/Hero';
import HelpGallery from './HelpGallery';
import DeviceSelector from './DeviceSelector';

class Help extends React.Component {
    render(){
        return(
            <div>
                <Hero image="/images/help.svg" heroHeader='Getting Stuck?' heroText='Follow this guide to get started'/>
                <h2>Which Device are you using?</h2>
                <DeviceSelector device = "mobile.jpeg" deviceName = "mobile"/>
                <DeviceSelector device = "desktop.jpeg" deviceName = "desktop"/>
                <HelpGallery media="mobile"/>
                <HelpGallery media="desktop"/>
            </div>
        )
    }
}

export default Help;
